package kr.or.ss.space.model.vo;

public class DashCost {

		private int dashCost;
		private int stateY;
		private int stateN;
		
		public DashCost() {
			super();
			// TODO Auto-generated constructor stub
		}

		public DashCost(int dashCost, int stateY, int stateN) {
			super();
			this.dashCost = dashCost;
			this.stateY = stateY;
			this.stateN = stateN;
		}

		public int getDashCost() {
			return dashCost;
		}

		public void setDashCost(int dashCost) {
			this.dashCost = dashCost;
		}

		public int getStateY() {
			return stateY;
		}

		public void setStateY(int stateY) {
			this.stateY = stateY;
		}

		public int getStateN() {
			return stateN;
		}

		public void setStateN(int stateN) {
			this.stateN = stateN;
		}

		
	
		
		
}
